/**
 * All proxy events have these basic properties, and may add more. See the
 * documentation for the specific proxy in question for information on the
 * other properties in the event object
 *
 * @property {number[]} time - The relative time that the event occured at.
 *      This is expressed as an array of two numbers as [seconds, nanoseconds]
 *      as returned from `process.hrtime()`
 * @property {number} timestamp - The timestamp the event occured in, as
 *      returned from `Date.now()`, i.e. milliseconds since UNIX epoch.
 */
export interface IProxyEvent {
    time: number[];
    timestamp: number;
    data;
}
